import React from "react";
import "./App.css";
import Login from "./compon/Login";
import Posts from "./compon/Posts";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <ul>
          <li>
            <Link to="/">Login</Link>
          </li>
          <li>
            <Link to="/about">Posts</Link>
          </li>
        </ul>
        <hr />
        <Routes>
          <Route exact path="/">
         <div>home</div>
          </Route>
          <Route path="/posts">
          <div>POSTS</div>
          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}
export default App;
